import React, {useState, useEffect} from 'react'
import axios from 'axios';
import Map from './Map'

function Main() {
    const [venues, setVenues] = useState([])

    useEffect(()=>{
        axios.get(`https://api.foursquare.com/v2/venues/search?client_id=LIEUSSAMWMOVTOT2NMXPTPQ1VJ5UIESU3EJKN53JV4QIKMZL&client_secret=1CYYIBFI2ETP0WMK5YDOXSMOYTPQ0CM4OQHOJNIPAQ3EMOYC&ll=ll="51.5074,0.1278"&query="mexican"&v=20189988`)
            .then(res => {
                const venues = res.data.response.venues;
                console.log(res);
                setVenues({ venues: venues })
            })
            .catch(err => {
                console.log(err)
            })
    }, [venues.location.lat, venues.location.long])

    return (
        <div>
            
            <Map
                
                markers={venues}
                containerElement={<div style={{ height: `400px`, width: `100%` }} />}
                mapElement={<div style={{ height: `100%`, width: `100%` }} />}
            />
        </div>
    )
}

export default Main
